mongoose.connect(mongoUrl, { useNewUrlParser: true, useUnifiedTopology: true });
mongoose.Promise = Promise;
const User = mongoose.model('User',{
  name:{
    type: String,
    unique: true
  },
  password:{
    type:String,
    required:true
  },
  accesToken:{
    type:String,
    default: () => crypto.randomBytes(128).toString('hex')
  }
}); // Close the User model definition

