const port = process.env.PORT || 8080;
const app = express();

const authenticate = async (req, res, next) => {
  const user = await User.findOne({accesToken:req.headers('Authorization')});
  if(user){
    req.user = user;
    next();
  } else {
    res.status(401).json({loggedOut: true});
  }
